product_desc:
Top ten achievements of  the Ten Years Business Incubators Program:
-          From January 2013 to May 2016 the pilot Project of the Program generated 500 Startups;
-  The first ever Western Africa High Impact Entrepreneurs Network is alive;
-  Two pilot incubators opened;
-  The rural incubation research started;
-  Healthcare support services are being provided;
- University Incubation became a reality with the first ever University Incub- Lab activities in the Country;
-  Business for Climate campaign is being occurred;
-  over 60 Entrepreneurship Trainers trained;
-  An international volunteer pool of development Expert available;
-  5 update Studies conducted on <Business opportunities in Mali> from 2011 to 2016.
New Partners and More Investment needed
On the line of SDGs achievement, trends above has to be increased for reaching the following purposes:
ð  5000 Startups generation by 2020
ð  15000 sustainable SME/SMI in activity by 2025
